import Component from 'react'
import DNights from "./Photos/Duplainville Prairie (2021).jpg"

const popup = (props) => {
  return (
    <div>
      <p>{props.message}</p>
      <button onClick={props.closeMe}>Close Popup</button>
    </div>
  );
}
